const express   = require('express');
const app       = express();

app.set('view engine', 'ejs');

app.get('/', (req, res) => {
    res.render('landing');
})

app.get('/campgrounds', (req, res) => {
    const campgrounds = [
        {name: 'Prince Desert Camp', image: 'data:image/jpeg;base64,'},
        {name: 'Jellystone Park Larkspur', image: 'data:image/jpeg;base64,'},
        {name: 'Herkimer Diamond KOA', image: 'data:image/jpeg;base64,'},
    ]

    res.render('campgrounds', {campgrounds: campgrounds});
})

app.listen(8000, () => {
    console.log('Server Started!');
})